import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";

export default function Home() {
  const [trendingItems, setTrendingItems] = useState([]);
  useEffect(() => {
    getTrendingItems();
  }, []);

  let getTrendingItems = async () => {
    let { data } = await axios.get(
      "https://api.themoviedb.org/3/trending/all/day?api_key=df0aad8d17f69e36bdd1a3de0d77194f"
    );
    setTrendingItems(data.results);
  };

  return (
    <>
      <div className="row">
        {trendingItems.map((item, index) => (
          <div key={index} className="col-md-2">
            <div className="item">
              <img className="" src={`https://image.tmdb.org/t/p/orginal${item.poster_path}`} alt="" />
              <h6>{item.title}{item.name}</h6>
            </div>
          </div>
        ))}
      </div>
    </>
  );
}
